// @flow weak

export default class Consumer {

  keyPath:string;
  versionRange:string;
  callback:Function;
  isDestroyed:boolean;

  constructor(keyPath, versionRange, callback) {
    this.keyPath = keyPath
    this.versionRange = versionRange
    this.callback = callback
    this.isDestroyed = false
  }

  destroy() {
    this.isDestroyed = true
  }

}
